import Router, { useRouter } from 'next/router';
import LoginButton from '../login-button';
import V2FlightSearch from '../v2-flight-search';
import FlightSearch from './../flight-search';
import V1FlightSearch from '../v1-flight-search';

const Header = (props?: any) => {
  const { asPath } = useRouter();
  const isReviewPage = asPath.endsWith('review_details');
  const isPaymentRoute = asPath.includes('payment');
  const isCancellationRoute = asPath.endsWith('cancellation');
  const isBookingDetailsRoute = asPath.includes('booking_details');
  const isV2Route = asPath.endsWith('v2');
  const isV1Route = asPath.endsWith('v1');
  const isEmptySearch = asPath == '/' || isV2Route;
  const isFrame = asPath.endsWith('v2_banner');
  let attachShadow;
  attachShadow = (host: any) => {
    if (host != null && host.shadowRoot != null) {
      host.attachShadow({ mode: 'open' });
      // @ts-ignore
      host.shadowRoot.innerHTML = host.innerHTML;
      host.innerHTML = '';
    }
  };
  if (asPath.endsWith('login') || asPath.endsWith('apikeys')) {
    return null;
  } else {
    return (
      <>
        {
          <header
            className={`${
              isReviewPage ||
              isPaymentRoute ||
              isBookingDetailsRoute ||
              isCancellationRoute
                ? 'pb-52'
                : 'pb-10'
            } ${isEmptySearch ? ' h-screen' : ''} ${isFrame ? 'hidden' : ''}
            ${isV1Route ? 'v1 h-screen' : isV2Route ? 'v2 h-screen' : 'v'} `}
          >
            <div className="sm:container xl:!px-4 2xl:!px-20 m-auto h-full">
              <div
                className={'w-full flex justify-between relative items-center'}
              >
                <div
                  onClick={() =>
                    isV2Route
                      ? window.open('../', '_blank')
                      : Router.push('../')
                  }
                  className="logo py-3.5 px-6 rounded-bl-[6px] rounded-br-[6px] cursor-pointer"
                >
                  <div ref={attachShadow}>
                    <svg
                      width="181"
                      height="91"
                      viewBox="0 0 181 91"
                      fill="none"
                      xmlns="http://www.w3.org/2000/svg"
                      xmlnsXlink="http://www.w3.org/1999/xlink"
                    >
                      <g filter="url(#filter0_b_654_29)">
                        <path
                          d="M3 -3H181V81C181 86.5228 176.523 91 171 91H13C7.47715 91 3 86.5228 3 81V-3Z"
                          fill="url(#paint0_linear_654_29)"
                          fillOpacity="0.5"
                        />
                        <path
                          d="M3.5 -2.5H180.5V81C180.5 86.2467 176.247 90.5 171 90.5H13C7.75329 90.5 3.5 86.2467 3.5 81V-2.5Z"
                          stroke="white"
                          strokeOpacity="0.5"
                        />
                      </g>
                      <rect
                        y="-3"
                        width="181"
                        height="94"
                        fill="url(#pattern0)"
                      />
                      <defs>
                        <filter
                          id="filter0_b_654_29"
                          x="-15"
                          y="-21"
                          width="214"
                          height="130"
                          filterUnits="userSpaceOnUse"
                          colorInterpolationFilters="sRGB"
                        >
                          <feFlood
                            floodOpacity="0"
                            result="BackgroundImageFix"
                          />
                          <feGaussianBlur
                            in="BackgroundImage"
                            stdDeviation="9"
                          />
                          <feComposite
                            in2="SourceAlpha"
                            operator="in"
                            result="effect1_backgroundBlur_654_29"
                          />
                          <feBlend
                            mode="normal"
                            in="SourceGraphic"
                            in2="effect1_backgroundBlur_654_29"
                            result="shape"
                          />
                        </filter>
                        <pattern
                          id="pattern0"
                          patternContentUnits="objectBoundingBox"
                          width="1"
                          height="1"
                        >
                          <use
                            xlinkHref="#image0_654_29"
                            transform="translate(0 -0.478723) scale(0.000925926 0.0017829)"
                          />
                        </pattern>
                        <linearGradient
                          id="paint0_linear_654_29"
                          x1="9"
                          y1="9.59794"
                          x2="172.834"
                          y2="95.1478"
                          gradientUnits="userSpaceOnUse"
                        >
                          <stop stopColor="white" />
                          <stop
                            offset="1"
                            stopColor="white"
                            stopOpacity="0.38"
                          />
                        </linearGradient>
                        <image
                          id="image0_654_29"
                          width="1080"
                          height="1080"
                          xlinkHref="data:image/png;base64,"
                        />
                      </defs>
                    </svg>
                  </div>
                </div>
                <LoginButton />
              </div>
              {!isReviewPage &&
                !isPaymentRoute &&
                !isBookingDetailsRoute &&
                !isCancellationRoute && (
                  <div
                    className={
                      isV1Route || isV2Route || props.v1 || props.v2
                        ? 'hidden'
                        : ''
                    }
                  >
                    <FlightSearch />
                  </div>
                )}
              {(isV2Route || props.v2) && (
                <div>
                  <V2FlightSearch />
                </div>
              )}

              {(isV1Route || props.v1) && (
                <div className="h-[calc(100%_-_110px)]">
                  <V1FlightSearch />
                </div>
              )}
            </div>
          </header>
        }
      </>
    );
  }
};

export default Header;
